(1, 'Reiniciar GALAC', '&#60;p&#62;Reiniciar GALAC&#60;br&#62;Apuntar por escritorio remoto al 10.10.20.3:&#60;br&#62;user: GESTION&#60;br&#62;password: **S0P0RTE2320**&#60;br&#62;------------------&#60;br&#62;user: Soporteit&#60;br&#62;password: Soporteit*22&#60;br&#62;Meterse en el de IVA y RENTA, SAW y NOMINA&#60;/p&#62;', 0, 2, 26, '2023-07-18 19:10:00', '2023-07-18 19:10:00', NULL, NULL),
(2, 'INSTALACIÓN DEL SOFTWARE MONEY', '&#60;p&#62;&#60;strong&#62;Instalación del software Money&#60;/strong&#62;&#60;/p&#62;\r\n&#60;p&#62;&#60;br&#62;El software Money se utiliza en una arquitectura de tipo cliente servidor, donde los clientes&#60;br&#62;son representados por las estaciones de trabajo donde se instala el software Money,&#60;br&#62;mientras que el servidor es simplemente un servidor de archivos que almacena una carpeta&#60;br&#62;compartida. En dicha carpeta se encuentran los archivos con extensión mbf, que son&#60;br&#62;interpretados por el software.&#60;/p&#62;\r\n&#60;p&#62;&#60;br&#62;Para agregar la carpeta compartida con los archivos de Money, abrimos un explorador&#60;br&#62;de archivos, y le damos clic derecho a “Este equipo”, para luego seleccionar “Conectar a&#60;br&#62;unidad de red…”:&#60;/p&#62;\r\n&#60;p&#62;Se nos va mostrar el wizard para conectar a una unidad de red. En el campo “Carpeta”&#60;br&#62;colocamos &#60;strong&#62;\\\\10.10.20.4\\COMPARTIDAS\\Money\\&#60;/strong&#62;, y seleccionamos “Examinar…”:&#60;/p&#62;\r\n&#60;p&#62;En caso de que nos pida credenciales, podemos intentar con:&#60;/p&#62;\r\n&#60;p&#62;&#60;strong&#62;Usuario:&#60;/strong&#62; Jose Gonzalez&#60;br&#62;&#60;strong&#62;Password:&#60;/strong&#62; *j0s3g0nz4l3z*&#60;/p&#62;\r\n&#60;p&#62;Para instalar el cliente Money, debemos descomprimir el archivo Money99-Inst-Win7.zip&#60;br&#62;en cualquier directorio de la estación de trabajo. El directorio descomprimido contiene los&#60;br&#62;archivos de instalación de Money.&#60;/p&#62;\r\n&#60;p&#62;&#60;br&#62;Para proceder, vamos al directorio \\Money99-Inst-Win7\\Money99\\setup, y damos doble&#60;br&#62;clic al archivo acmsetup.exe.&#60;/p&#62;\r\n&#60;p&#62;&#60;br&#62;Nota: en este mismo directorio hay otra carpeta llamada Setup, que contiene un archivo con&#60;br&#62;el mismo nombre, pero NO debemos ejecutarlo, ya que la instalación fallará. El archivo&#60;br&#62;correcto se encuentra en &#60;strong&#62;\\Money99-Inst-Win7\\Money99\\setup&#60;/strong&#62;.&#60;/p&#62;\r\n&#60;p&#62;Ejecutamos el instalador. En Nombre y organización, colocamos Netcom Plus.&#60;/p&#62;\r\n&#60;p&#62;Luego, aparecerán varias ventanas, incluyendo el acuerdo de licencia, a todas le damos&#60;br&#62;Aceptar siempre.&#60;br&#62;En este punto, presionamos el botón grande:&#60;/p&#62;\r\n&#60;p&#62;Seleccionamos el país, y esperamos a que se copien los archivos de instalación.&#60;br&#62;Una vez finalizada la instalación, buscamos el programa en el menú Inicio, y lo ejecutamos.&#60;br&#62;A la primera ejecución, nos sale una ventana para configurar el perfil. Esto podemos&#60;br&#62;ignorarlo, y simplemente cerrar la ventana.&#60;/p&#62;\r\n&#60;p&#62;&#60;br&#62;Ahora, nos vamos a Archivo - Abrir…, y seleccionamos la unidad compartida que&#60;br&#62;agregamos al principio de la guía:&#60;/p&#62;\r\n&#60;p&#62;En este directorio están todos los archivos Money. Podemos abrir cualquiera para&#60;br&#62;corroborar que funciona la instalación. Si el archivo no arroja error, todo está en orden.&#60;br&#62;Nota: este software está limitado a que más de una estación de trabajo se encuentre&#60;br&#62;operando sobre el mismo archivo Money. Si más de una persona opera sobre un mismo&#60;br&#62;archivo, se van a perder cambios, y es muy probable que se corrompa el archivo.&#60;/p&#62;', 0, 2, 9, '2023-07-19 02:19:50', '2023-07-20 01:04:50', NULL, NULL);

