--
-- Disparadores `glpi_tickets`
--
DELIMITER $$
CREATE TRIGGER `poner_id_ticket` AFTER INSERT ON `glpi_tickets` FOR EACH ROW BEGIN
DECLARE ultimo_ticket INT;
DECLARE ultimo_formulario INT;
DECLARE numero_ticket INT;
DECLARE correo_usuario varchar(255);
DECLARE origen_ticket varchar(255);
SET origen_ticket = (SELECT requesttypes_id FROM glpi_tickets order by id desc limit 1);
IF (origen_ticket=7) THEN
SET ultimo_ticket = (SELECT id FROM glpi_tickets order by id desc limit 1);
SET ultimo_formulario = (SELECT plugin_formcreator_forms_answers_id FROM glpi_plugin_formcreator_answers ORDER BY id DESC LIMIT 1);
SET correo_usuario = (SELECT answer FROM glpi_plugin_formcreator_answers WHERE plugin_formcreator_forms_answers_id = ultimo_formulario AND plugin_formcreator_questions_id =2 ORDER BY id DESC LIMIT 1);
INSERT INTO tmp_prueba (ultimo_ticket,ultimo_formulario,correo_usuario) VALUES (ultimo_ticket,ultimo_formulario,correo_usuario);
END IF;
END
$$
DELIMITER ;

